(1298, 'Inntel Hotels Amsterdam Centre', 'inntel-hotels-amsterdam-centre', 80, 'Nieuwezijds Kolk', '19', '1012PV', 'Amsterdam', 'NH', 4, 279, '15:00:00', '00:00:00', '00:00:00', '12:00:00', '', '', '', '', ''),
(1300, 'Inntel Hotels Rotterdam Centre', 'inntel-hotels-rotterdam-centre', 80, 'Leuvehaven', '80', '3011EA', 'Rotterdam', 'ZH', 4, 265, '15:00:00', '00:00:00', '00:00:00', '12:00:00', '', 'Whirlpool & Privé Sauna Suite', 'Met King size Hästens bed', 'Uitzicht op de Erasmusbrug', 'Het design Inntel Hotels Rotterdam Centre ligt in het centrum van Rotterdam aan de voet van de Erasmusbrug. Op loopafstand vind je de levendige Witte de Withstraat en de vele andere leuke winkels, restaurants en musea. Rotterdam Centraal ligt op korte wandelafstand van het hotel. Bij dit luxe hotel krijg je uiteraard een glaasje bubbels bij het ontbijt.\r\n\r\nDe Panorama Junior Suite met privé sauna is de meest royale suite van het hotel en staat garant voor het beste uitzicht dat Rotterdam te bieden heeft. Naast de comfortabele Montis fauteuils en Italiaanse designverlichting beschikt deze kamer ook over een tropische regendouche en een whirlpool bad. Maak gebruik van de badjassen en slippers de kamers en laat het ultieme relaxen beginnen.\r\n\r\nAls gast krijg je gratis entree tot de Wellness Club H2O met zwembad, Turks stoombad & Finse sauna'),
