(3917, 'Inntel Hotels Amsterdam Zaandam', 'inntel-hotels-amsterdam-zaandam', 80, 'Provincialeweg', '102', '1506MD', 'Zaandam', '', 4, 159, '15:00:00', '00:00:00', '00:00:00', '12:00:00', '', 'Whirlpool & Privé Sauna Suite', 'XL King size bed & Nespresso', 'Heerlijk ontbijt met bubbels', 'Bijzonder overnachten doe je in het Inntel hotel Amsterdam Zaandam. Dit luxe hotel valt direct op door de in het oog springende gevel van Zaanse huisjes. Ideaal gelegen in het centrum en vlak bij het treinstation.Bij dit luxe hotel krijg je uiteraard een glaasje bubbels bij het ontbijt.\r\n\r\nKies uit de luxe Grondleggers Junior Suite met XL King size bed, Nespresso apparaat, whirlpool & privé sauna of de Grondleggers Suite gelegen op de 12e etage van het hotel met een adembenemend uitzicht op Zaandam, een aparte woon- en slaapgedeelte, XL King size bed, Nespresso apparaat, whirlpool & privé sauna\r\n\r\nAls gast krijg je gratis entree tot de superluxe Wellness Club met zwembad, Finse sauna & Turks stoombad.'),
