(5461, 'Inntel Hotels Utrecht Centre', 'inntel-hotels-utrecht-centre', 80, 'Smakkelaarshoek', '24', '3511EC', 'Utrecht', '', 4, 162, '15:00:00', '00:00:00', '00:00:00', '12:00:00', '', 'Spa Kamer met XXL whirlpool', 'Suite met Privé Sauna', 'Heerlijk ontbijt met bubbels', 'Ideaal gelegen in het centrum. Direct naast Utrecht Centraal en Shopping Mall Hoog Catharijne.  Bij dit luxe hotel krijg je uiteraard een glaasje bubbels bij het ontbijt.\r\n\r\nKies uit een luxe ingerichte Spa Kamer met XXL whirlpool, Inntel LXRY kingsize bed, airco & koffie- en theefaciliteiten of de ultraluxe Wellness Kamer met een fenomenaal uitzicht XXL whirlpool & privé sauna, Inntel LXRY kingsize bed, airco & Nespresso apparaat.\r\n\r\nAls gast krijg je gratis entree tot Spa Dôme op de hoogste verdieping van het hotel. Neem een duik in het zwembad of kom tot rust in de Finse sauna en het Turks stoombad.'),
